import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../Header/header.css";
import image1 from "../images/headerimage.jpg";

function Header() {
    return(
        <div class="header-container">
            <div class="headleft-container">
                <div class="headleft-content">
                    <img src={image1} />
                </div>
            </div>
            <div class="headright-container">
                <div class="headright-content">
                    <h4>WRAP</h4>
                    <p>It self-adhesive so just use the pressure and warmth from your hands to shape and mold Abeego over or around your food.</p>
                </div>
            </div>
        </div>
    )
}

export default Header;
